						var fileid	 = metadata.id;
						var fileName = metadata.name;
						var fileSize = metadata.size; //in bytes
						var fileType = metadata.name.split(".");
						fileType = fileType[(fileType.length)-1];
						
						//boxFolderFilesJson[fileid]={"fileid":fileid,"boxMappingRecordId":boxMappingRecordId,"fileName":fileName,"fileSize":fileSize,"fileDownloadUrl":fileDownloadUrl,"fileType":fileType,"nsRecordId":nsRecordId,"nsRecordType":nsRecordType,"skydocFolderIntId":skydocFolderIntId}
