	function isFolderPublicSearch(skydocFolderId){
		if(skydocFolderId){
				var folderIdSearch = search.create({
					type: 'customrecord_tss_aws_to_ns_folder',
					filters:
					[
						["internalid","anyof",[skydocFolderId]], 
							"AND", 
						["isinactive","is","F"]
					],
					columns:
					[
						search.createColumn({
							name: "internalid",
							sort: search.Sort.ASC,
							label: "Internal ID"
						}),
						search.createColumn({
							name: "custrecord_tss_aws_s3_ns_public"
							})
					]
				});
			
			var folderIdSearchResults = folderIdSearch.run().getRange(0,10);
			if(folderIdSearchResults.length>1){
				throw {name:'customError',message:'Multiple folders found with folderId: '+skydocFolderId+''};
			}else if(folderIdSearchResults.length==0){
				throw {name:'customError',message:'Folder not found with folderId: '+skydocFolderId+''};
			}
			var folderIsPublic=folderIdSearchResults[0].getValue("custrecord_tss_aws_s3_ns_public");
			log.debug("folderIsPublic",folderIsPublic);
			return folderIsPublic;
		}else{
			return false;
		}
	}

